<script setup>
import { computed, reactive } from 'vue';
import { useGlobalStore } from '../stores/global'
import { useContentStore } from '../stores/content';

const globalVariables = useGlobalStore();
const content = useContentStore();

const props = defineProps({
  color: {
    type: String,
    required: true,
  },
  wheels: {
    type: String,
    required: true,
  },
  configuratorMode: {
    type: Boolean,
    default: false,
  }
});

let state = reactive({ 
  hoveredPin: null,
  pinsUnhovered: true,
  r: 3.5,
});

const extras = globalVariables.configuration.extras;
const configuratorMode = props.configuratorMode;
const explorePoints = content.models[0].explorePoints;

/*If one of the points of interest are not hovered or clicked, 
animate them to make it clear that they are interactive elements */

function pinAnimation() {
  if (state.pinsUnhovered) {
    state.r === 4.5 ? state.r = 3.5 : state.r = 4.5;
  };
}

function resetPinAnimation() {
    state.r = 3.5;
    clearInterval(pinAnimation);
}

if (!configuratorMode) {setInterval(pinAnimation, 600)};

/*Every option checks for the prop configuratorMode, to check if this component 
rendered in the explore-view or configurator view. Only configurator view should show the options */

const ornament = computed(() => {
   if(extras.some(extra => extra.id === 'ornament') && configuratorMode)
   return 'inline';
});

const rack = computed(() => {
   if(extras.some(extra => extra.id === 'rack') && configuratorMode)
   return 'inline';
});

const high_beams = computed(() => {
   if(extras.some(extra => extra.id === 'high_beams') && configuratorMode)
   return 'inline';
});

const spoiler = computed(() => {
   if(extras.some(extra => extra.id === 'spoiler') && configuratorMode)
   return 'inline';
});

console.log(globalVariables.svgStates.configuration)
</script>

